import axios from "axios";

export const validateEmail = async email => {
  try {
    const res = await axios.post(`${URL}/signin`, {
      params: { email: "moral@gmail.com" }
    });

    console.logg("show");
  } catch (error) {
    console.log(error);
  }
};
